texte:
@KTLS_R Ig farben : démantelée en 1952, Allemande

Moderna : fondée en 2010 : américaine.

On doit vraiment se demander si il y a un lien entre les 2? Sérieusement lapinou?

@PrinLombardo Les soignants de 55 ans &amp; ➕ sont invités à se faire vacciner avec des vaccins #AstraZeneca.
Les ➖ de 55 ans avec des vaccins #Pfizer / #Moderna. 

Qu’importe le vaccin : c’est la #vaccination (des professionnels de santé ici) qui compte. Tous peuvent se faire vacciner.
